import React from "react";

import { IconButton, InputAdornment, TextField } from "@material-ui/core";
import VisibilityOffIcon from "@material-ui/icons/VisibilityOff";
import VisibilityIcon from "@material-ui/icons/Visibility";
import { ItextfIeldLogin } from "./log-Interfaces";
import { isTablet } from "react-device-detect";

function TextFieldLoginx({
  updateLoginvalues,
  rawLoginValues,
  ShowLoginPasswordForaWhile,
  loginShowPassword,
  size,
  passwordType,
  withHolder,
  setmobileTextFieldFocus,
  mobileTextFieldFocus,
}: ItextfIeldLogin): JSX.Element {
  const matchTablet = isTablet;

  var width = " ";
  var sizex: "small" | "medium" | undefined = undefined;
  var position = "static";
  var bottom = "";
  var zindexPop = 0;

  switch (size) {
    case "small":
      sizex = "small";
      width = "99%";
      var transform = "scale(0.94)";
      var zIndex = 0;
      var font1 = "";
      var font2 = "";
      break;
    case "smallTablet":
      sizex = "small";
      width = "62%";
      var transform = "scale(1)";
      var zIndex = 0;
      var font1 = "2.6vh";
      var font2 = "2vh";
      break;
    default:
      sizex = "medium";
      width = withHolder;
      var transform = "scale(1)";
      var zIndex = 1;
      var font1 = "2.7vh";
      var font2 = "1.9vh";
  }

  if (size === "small" || size === "smallTablet") {
    if (mobileTextFieldFocus) {
      position = "fixed";
      bottom = "2em";
    } else {
      position = "static";
      bottom = "0px";
    }
  }

  ///
  ///
  ///
  ///ON  MOBILE TEXTFIELD FOCUS
  var textfieldFocusIndex = 0;
  var textfieldFocusDisplay = "none";

  if (mobileTextFieldFocus) {
    textfieldFocusIndex = 12;
    textfieldFocusDisplay = "block";
    zindexPop = 20;
  } else {
    textfieldFocusIndex = 0;
    textfieldFocusDisplay = "none";
    zindexPop = 0;
  }
  return (
    <>
      {passwordType ? (
        <TextField
          size={sizex}
          inputProps={{ style: { fontSize: font1 } }}
          InputLabelProps={{ style: { fontSize: font2 } }}
          style={{
            transform: transform,
            width: width,
            paddingBottom: "40px",
            zIndex: zIndex,
          }}
          label="Password"
          onChange={updateLoginvalues}
          type={loginShowPassword ? "text" : "password"}
          name="inputedPassword"
          value={rawLoginValues.inputedPassword}
          variant="standard"
          InputProps={{
            endAdornment: (
              <InputAdornment position="end">
                <IconButton
                  onMouseDown={ShowLoginPasswordForaWhile}
                  aria-label="toggle password visibility"
                >
                  {loginShowPassword ? (
                    <VisibilityIcon />
                  ) : (
                    <VisibilityOffIcon />
                  )}
                </IconButton>
              </InputAdornment>
            ),
          }}
        />
      ) : (
        <TextField
          onFocus={() => setmobileTextFieldFocus(true)}
          onBlur={() => setmobileTextFieldFocus(false)}
          size={sizex}
          inputProps={{ style: { fontSize: font1 } }}
          InputLabelProps={{ style: { fontSize: font2 } }}
          style={{
            transform: transform,
            width: width,
            paddingBottom: "70px",
            position: position,
            bottom: bottom,
            zIndex: zindexPop,
          }}
          label="Username"
          margin="normal"
          type="text"
          onChange={updateLoginvalues}
          name="inputedUsername"
          value={rawLoginValues.inputedUsername}
          variant="standard"
        />
      )}
    </>
  );
}

export const TextFieldLogin = React.memo(TextFieldLoginx);
